/**
 * Stores the location of an ingredient in each 100gr.
 * @var country_ Contains the country of the ingredient.
 * @var city_ Contains the city of the country.
 * @var street_ Contains the street of the city.
 * @var portal_ Contains the portal of the street.
 */
 export class Location {
  private country_: string;
  private city_: string;
  private street_: string;
  private portal_: number;

  /**
   * Stores the nutritionla values.
   * @param newCountry_ Contains the country of the ingredient.
   * @param newCity_ Contains the city of the country.
   * @param newStreet_ Contains the street of the city.
   * @param newPortal_ Contains the portal of the street.
   */
  constructor(newCountry: string, newCity: string, newStreet: string, newPortal: number) {
    this.country_= newCountry;
    this.city_= newCity;
    this.street_= newStreet;
    this.portal_=newPortal;
  }


  /** SETTERS **/

  /**
   * Sets a new value for the country.
   * @param newCountry Contains the country of the ingredient.
   */
  public set country(newCountry: string) {
    this.country_ = newCountry;
  }

  /**
   * Sets a new value for the city.
   * @param newCity Contains the city of the ingredient.
   */
   public set city(newCity: string) {
    this.city_ = newCity;
  }

  /**
   * Sets a new value for the street.
   * @param newStreet Contains the street of the ingredient.
   */
   public set street(newStreet: string) {
    this.street_ = newStreet;
  }

  /**
   * Sets a new value for the portal.
   * @param newPortal Contains the portal of the ingredient.
   */
   public set portal(newPortal: number) {
    this.portal_ = newPortal;
  }


  /** GETTERS **/

  /**
   * Returns the value of the country.
   * @returns The country of the ingredient.
   */
  public get country(): string {
    return this.country_;
  }

  /**
   * Returns the value of the city.
   * @returns The city of the ingredient.
   */
  public get city(): string {
    return this.city_;
  }

  /**
   * Returns the value of the street.
   * @returns The street of the ingredient.
   */
  public get street(): string {
    return this.street_;
  }

  /**
   * Returns the value of the portal.
   * @returns The portal of the ingredient.
   */
  public get portal(): number {
    return this.portal_;
  }
}

import {Location} from './Location'
import {FoodGroup} from './Enums'
import {MacroNutrients} from './MacroNutrients'

/**
 * Stores a simple ingredient.
 * @var name_ Name of the ingredient.
 * @var price_ Price of the ingredient for each 100gr.
 * @var location_ Origin of the ingredient.
 * @var foodGroup_ Food group of the ingredient.
 * @var macroNutrients_ Macronutrients in each 100gr.
 * @var amount_ Amount of the ingredient count in grams.
 */
export class Ingredient {
  private name_: string;
  private price_: number;
  private location_: Location;
  private foodGroup_: FoodGroup;
  private macroNutrients_: MacroNutrients;
  private amount_: number;

  /**
   * Stores all the values.
   * @param newPrice Price of the ingredient.
   * @param newLocation Origin of the ingredient.
   * @param newFoodGroup Food group of the ingredient.
   * @param newMacroNutrients Macronutrients in each 100gr of the ingredient.
   */
  constructor(newName: string, newPrice: number, newLocation: Location, newFoodGroup: FoodGroup, newMacroNutrients: MacroNutrients, newAmount: number) {
    this.name_ = newName;
    this.price_ = newPrice;
    this.location_ = newLocation;
    this.foodGroup_ = newFoodGroup;
    this.macroNutrients_ = newMacroNutrients;
    this.amount_ = newAmount;
  }

  /**
   * Calculates the nutritional values in all the ingredient.
   * @returns the nutritional values in all the ingredient.
   */
  public getNutritionalValues(): MacroNutrients {
    let result: MacroNutrients = this.macroNutrients;
    result.carbohydrates = (this.amount * result.carbohydrates) / 100;
    result.lipids = (this.amount * result.lipids) / 100;
    result.proteins = (this.amount * result.proteins) / 100;
    return result;
  }

  /**
   * Calculates the nprice of the ingredient.
   * @returns the nprice of the ingredient.
   */
  public getPrice(): number {
    return (this.amount * this.price) / 100;
  }


  /** SETTERS **/

  /**
   * Sets a new value for the name.
   * @param newName Contains the name of the ingredient.
   */
  public set name(newName: string) {
    this.name_ = newName;
  }

  /**
   * Sets a new value for the price.
   * @param newPrice Contains the price of the ingredient.
   */
  public set price(newPrice: number) {
    this.price_ = newPrice;
  }

  /**
   * Sets a new value for the location.
   * @param newLocation Contains the location of the ingredient.
   */
   public set location(newLocation: Location) {
    this.location_ = newLocation;
  }

  /**
   * Sets a new value for the foodGroup.
   * @param newFoodGroup Contains the foodGroup of the ingredient.
   */
   public set foodGroup(newFoodGroup: FoodGroup) {
    this.foodGroup_ = newFoodGroup;
  }

  /**
   * Sets a new value for the macroNutrients.
   * @param newMacroNutrients Contains the macroNutrients of the ingredient.
   */
   public set macroNutrients(newMacroNutrients: MacroNutrients) {
    this.macroNutrients_ = newMacroNutrients;
  }

  /**
   * Sets a new value for the amount.
   * @param newAmount Contains the amount of the ingredient.
   */
   public set amount(newAmount: number) {
    this.amount_ = newAmount;
  }


  /** GETTERS **/

  /**
   * Returns the value of the name.
   * @returns The name of the ingredient.
   */
  public get name(): string {
    return this.name_;
  }

  /**
   * Returns the value of the price.
   * @returns The price of the ingredient.
   */
  public get price(): number {
    return this.price_;
  }

  /**
   * Returns the value of the location.
   * @returns The location of the ingredient.
   */
  public get location(): Location {
    return this.location_;
  }

  /**
   * Returns the value of the foodGroup.
   * @returns The foodGroup of the ingredient.
   */
  public get foodGroup(): FoodGroup {
    return this.foodGroup_;
  }

  /**
   * Returns the value of the macroNutrients.
   * @returns The macroNutrients of the ingredient.
   */
  public get macroNutrients(): MacroNutrients {
    return this.macroNutrients_;
  }

  /**
   * Returns the value of the amount.
   * @returns The amount of the ingredient.
   */
  public get amount(): number {
    return this.amount_;
  }
}

/**
 * Stores the macronutrients of an ingredient in each 100gr.
 * @var carbohydrates_ Contains the carbohydrates in 100gr.
 * @var proteins_ Contains the proteins in 100gr.
 * @var lipids_ Contains the lipids in 100gr.
 */
export class MacroNutrients {
  private carbohydrates_: number;
  private proteins_: number;
  private lipids_: number;

  /**
   * Stores the nutritionla values.
   * @param newCarbohydrates_ Contains the carbohydrates in 100gr.
   * @param newProteins_ Contains the proteins in 100gr.
   * @param newLipids_ Contains the lipids in 100gr.
   */
  constructor(newCarbohydrates: number, newProteins: number, newLipids: number) {
    this.carbohydrates_ = newCarbohydrates;
    this.proteins_ = newProteins;
    this.lipids_ = newLipids;
  }


  /** SETTERS **/

  /**
   * Sets a new value for carbohydrates.
   * @param newCarbohydrates Contains the carbohydrates in 100gr.
   */
  public set carbohydrates(newCarbohydrates: number) {
    this.carbohydrates_ = newCarbohydrates;
  }

  /**
   * Sets a new value for proteins.
   * @param newProteins Contains the proteins in 100gr.
   */
   public set proteins(newProteins: number) {
    this.proteins_ = newProteins;
  }

  /**
   * Sets a new value for lipids.
   * @param newLipids Contains the lipids in 100gr.
   */
   public set lipids(newLipids: number) {
    this.lipids_ = newLipids;
  }


  /** GETTERS **/

  /**
   * Returns the value of the carbohydrates.
   * @returns The carbohydrates in 100gr.
   */
  public get carbohydrates(): number {
    return this.carbohydrates_;
  }

  /**
   * Returns the value of the proteins.
   * @returns The proteins in 100gr.
   */
  public get proteins(): number {
    return this.proteins_;
  }

  /**
   * Returns the value of the lipids.
   * @returns The lipids in 100gr.
   */
  public get lipids(): number {
    return this.lipids_;
  }
}
